import './App.css';
import Login from './Login';
import Home from './Home';
import Signup from './Signup';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import PickLeagues from './PickLeagues';
import PickTeams from './PickTeams';
import { UserProvider } from './UserContext'
import Auth0ProviderWithHistory from "./auth/Auth0ProviderWithHistory";
import { useAuth0 } from "@auth0/auth0-react";
import ProtectedRoute from './auth/ProtectedRoute';
import { useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Hello from './Hello'


function App() {

  useEffect( () => {

    async function fetchApi(){

      const data = await fetch('/api/user');
      const text = await data.text();

      console.log(text);

    }

    fetchApi()
  } 
  )




  return (

      <UserProvider>
        <h1 style={{textAlign:"center"}}>MySportsHub</h1>
        <Router>
          <Auth0ProviderWithHistory>
            <div className="App">
              <div className="App-container">            
                  <Switch>
                    <Route path="/" exact component={Home} />
                    <Route path="/Home" component={Hello} />
                    <ProtectedRoute path="/Signup" component={Signup} />
                    <ProtectedRoute path="/PickLeagues" exact component={PickLeagues} />
                    <ProtectedRoute path="/PickTeams" exact component={PickTeams} />
                  </Switch>
              </div>
            </div>
            </Auth0ProviderWithHistory>
        </Router>
      </UserProvider>
  );
}

export default App;
